import { mdiDesktopMac } from "@mdi/js";

export default [
  "HIRING SIDE",
  [
    {
      to: "/",
      icon: mdiDesktopMac,
      label: "Dashboard",
    },
  ],

  "BACKEND SIDE",
  [
    {
      to: "/organizations",
      label: "Organization",
      updateMark: true,
     // give me a better icon from this library icon: mdiDesktopMac,
    },
  ],
];

